:\"7.85\"}},\"team\":{\"id\":1581722,\"name\":\"syd12nyjets's Team\",\"initials\":\"ST\"}}},{\"timeEpochMilli\":\"1594385354000\",\"transaction\":{\"type\":\"TRANSACTION_IMPORT\",\"player\":{\"proPlayer\":{\"id\":15585,\"nameFull\":\"Tee Higgins\",\"nameShort\":\"T. Higgins\",\"proTeamAbbreviation\":\"CIN\",\"position\":\"WR\",\"headshotUrl\":\"https://d26bvpybnxg29h.cloudfront.net/nfl/15585.png\",\"nflByeWeek\":9,\"news\":[{\"timeEpochMilli\":\"1606086621000\",\"contents\":\"Higgins caught three of 10 targets for 26 yards in Sunday's 20-9 loss to Washington.\",\"analysis\":\"Higgins wasn't on the same page with Joe Burrow in the first half, and things only got worse when Ryan Finley took over under center after Burrow was carted off with a season-ending knee injury. Despite finishing only one target shy of Tyler Boyd's team-leading total, Higgins ranked fifth on the team in yards. With the downgrade from Burrow to Finley moving forward, it's possible that the momentum from Higgins' promising rookie season will grind to a screeching halt against the Giants in Week 12 and beyond. Finley threw for just 30 yards and an interception in almost a half of action, but it's worth seeing whether he's able to bounce back with some starter's reps under his belt before cutting bait with any of Cincinnati's prominent pass-catchers.\",\"title\":\"Just 26 yards on 10 targets\"},{\"timeEpochMilli\":\"1606088498000\",\"contents\":\"Cincinnati Bengals wide receiver Tee Higgins had three catches for 26 yards during the Week 11 loss to Washington. The rookie saw 10 targets on Sunday but wasn't able to get anything going. Instead, he took a back seat to Tyler Boyd, who had nine receptions for 85 yards. With Joe Burrow (knee) potentially done for the year, Higgins will have to develop a rapport with presumptive starter Ryan Finley, which may ultimately decrease his fantasy stock moving ahead.\",\"url\":\"https://www.rotoballer.com/player-news/tee-higgins-struggles-against-washington/80685